import styles from '../components/passwordbox.module.css'

function Passwordbox() {
  return (
    <div className={styles.passwordbox}>

    <div className={styles.divTable}>
    <div className={styles.divTableBody}>
    <div className={styles.divTableRow}>
    <div className={styles.divTableCell}>&nbsp;Password:</div>
    <div classNam={styles.divTableCell}>&nbsp;</div>
    </div>
    <div className={styles.divTableRow}>
    <div className={styles.divTableCell}>&nbsp;Confirm Password</div>
    <div className={styles.divTableCell}>&nbsp;</div>
    </div>
    </div>
    </div>

    </div>
  );
}

export default Passwordbox;
